// Contact.jsx
import React from 'react';
import '../assets/styles/App.css';

const Contact = () => {
  return (
    <div className="content">
      <div>
        <img src="../imgs/sigilism-contact.png" alt="" />
      </div>
      <h1 style={{ color: '#e96f7c', textAlign: 'center' }}>
        - Contact -
        <br />
        In maintenance
      </h1>
    </div>
  );
};

export default Contact;
